import {View} from 'react-native'
import React from 'react';

import Cabecalho from './components/Cabecalho';
import Corpo from './components/Corpo';
import Disciplina from './components/Disciplina';

export default function App() {
  return (
    <View>
      <Cabecalho/>
      <Corpo/>
      <Disciplina/>
    </View>
  );
}
